import React from 'react';
import { useSelector } from 'react-redux';
import AboutGame from '../AboutGame';
import GamePage from '../GamePage/GamePage';

export default function MainPage() {
  const user = useSelector((store) => store.user);

  return (
    <>
      {user
        ? (<GamePage />)
        : (<AboutGame />)}
    </>
  );
}
